import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { usersType } from '../../types/Types'

const Profile = () => {
    const dispatch = useDispatch()
    const {current}: {current: usersType} = useSelector((state: any) => state.current)
  return (
    <div style={{height: "80px", display: "flex", flexDirection: "row", gap: "30px"}}>
        <h4>{current.name}</h4>
        <h4>{current.email}</h4>
        <button></button>
    </div>
  )
}

export default Profile
